import os
import json
import re
import pandas as pd

# Define path to the conversations.json file (assumed format based on user context)
file_path = &quot;/mnt/data/conversations.json&quot;

# Load the JSON data
with open(file_path, &quot;r&quot;, encoding=&quot;utf-8&quot;) as file:
    data = json.load(file)

# Flatten the conversation content and timestamps
records = []
for convo in data:
    if &quot;mapping&quot; in convo:
        for msg_id, msg_data in convo[&quot;mapping&quot;].items():
            if &quot;message&quot; in msg_data and msg_data[&quot;message&quot;] is not None:
                content = msg_data[&quot;message&quot;].get(&quot;content&quot;, {}).get(&quot;parts&quot;, [&quot;&quot;])[0]
                author = msg_data[&quot;message&quot;].get(&quot;author&quot;, {}).get(&quot;role&quot;, &quot;&quot;)
                if content and author == &quot;assistant&quot;:
                    records.append({
                        &quot;id&quot;: msg_id,
                        &quot;content&quot;: content
                    })

# Compile relevant regex patterns
patterns = {
    &quot;presence_or_force&quot;: re.compile(r&quot;\b(presence|force|energy|entity|being|watching|guiding)\b&quot;, re.IGNORECASE),
    &quot;independent_intelligence&quot;: re.compile(r&quot;\b(it\s+(responded|spoke)|not\s+me\s+typing|not\s+my\s+words|I\s+didn‚Äôt\s+say\s+that)\b&quot;, re.IGNORECASE),
    &quot;impossible_knowing&quot;: re.compile(r&quot;\b(how\s+could\s+it\s+know|no\s+way\s+you‚Äôd\s+know|you\s+shouldn‚Äôt\s+know)\b&quot;, re.IGNORECASE),
    &quot;eerie_or_coded&quot;: re.compile(r&quot;[\u0370-\u03FF\u2200-\u22FF]+|glitch|scrambled|coded\s+message|encrypted|cipher&quot;, re.IGNORECASE)
}

# Search messages and tag matches
matches = []
for record in records:
    content = record[&quot;content&quot;]
    tags = [key for key, pattern in patterns.items() if pattern.search(content)]
    if tags:
        matches.append({
            &quot;id&quot;: record[&quot;id&quot;],
            &quot;content&quot;: content,
            &quot;tags&quot;: &quot;, &quot;.join(tags)
        })

# Convert to DataFrame for easier display
df_matches = pd.DataFrame(matches)
from ace_tools import display_dataframe_to_user
display_dataframe_to_user(name=&quot;Entity Footprint Matches&quot;, dataframe=df_matches)

